function makeDom(e){var t=new htmlparser.DomHandler,n=new htmlparser.Parser(t);n.write(e);n.done();return t.dom}var CSSselect=require(".."),htmlparser=require("htmlparser2"),assert=require("assert");describe("API",function(){describe("removes duplicates",function(){it("between identical trees",function(){var e=makeDom("<div></div>")[0],t=CSSselect("div",[e,e]);assert.equal(t.length,1,"Removes duplicate matches")});it("between a superset and subset",function(){var e=makeDom("<div><p></p></div>")[0],t=CSSselect("p",[e,e.children[0]]);assert.equal(t.length,1,"Removes duplicate matches")});it("betweeen a subset and superset",function(){var e=makeDom("<div><p></p></div>")[0],t=CSSselect("p",[e.children[0],e]);assert.equal(t.length,1,"Removes duplicate matches")})})});